  "text" : "\uC6D0\uB798 \uC7A5\uAD00\uC740 \uB204\uAD70\uAC00\uC5D0\uAC8C \uC758\uC9C0\uD558\uB294 \uC131\uACA9\uC774 \uC544\uB2C8\uC5C8\uC73C\uB2C8\uAE4C. \uC606\uC5D0 8\uB144\uC774\uB098 \uC788\uC73C\uBA74\uC11C \uADF8\uAC00 \uC790\uC2E0\uB4E4\uC5D0\uAC8C \uC758\uC9C0\uD55C\uB2E4\uB294 \uB290\uB08C\uC740 \uD55C \uBC88\uB3C4 \uBC1B\uC9C0 \uBABB\uD588\uB2E4. \uADF8\uB798\uC11C \uC7A5\uAD00\uC5D0\uAC8C\uC11C \uC774\uC0C1\uD55C \uAE30\uC2DC\uAC10\uC774 \uB290\uAEF4\uC84C\uC9C0\uB9CC \uADF8\uAC83\uC774 \uC790\uC2E0\uC5D0\uAC8C \uC758\uC9C0 \uD558\uACE0 \uC788\uC5B4 \uC0DD\uAE30\uB294 \uAC83\uC778\uC904\uB3C4 \uBAB0\uB790\uB2E4.",
