  "text" : "\uBE14\uB8E8\uB178\uAC00 \uC7A5\uAD00\uB2D8\uC744 \uBE7C\uB3CC\uB9AC\uB824 \uD574\uB3C4 \uCE74\uCFE0\uC758 \uC55E\uC5D0\uC11C\uB294 \uBD88\uAC00\uB2A5\uD55C \uC77C. \uBB34\uB825\uC740 \uCE74\uCFE0\uAC00 \uC555\uB3C4\uC801\uC774\uAE30 \uB54C\uBB38\uC774\uB2E4. \uB54C\uBB38\uC5D0 \uBE14\uB8E8\uB178\uAC00 \uADF8 \uC0AC\uC774 \uC5BC\uAD74 \uBCF8\uC744 \uB730 \uC218 \uC788\uC5C8\uB2E4\uBA74 \uCE74\uCFE0\uC5D0\uAC8C \uC7A5\uAD00\uB2D8\uC758 \uD0C8\uC744 \uC4F4 \uB2E4\uB978 \uC0AC\uB78C\uC744 \uB118\uAE40\uC73C\uB85C\uC368 \uC2DC\uAC04\uC744 \uBC8C \uC218 \uC788\uB2E4.",
