  "text" : "\uBB3C\uB860 \uC0AC\uC2E4\uC740 \uC544\uB2C8\uC5C8\uC9C0\uB9CC. \uBC31\uC9C0\uC758 \uC7A5\uAD00\uC740 \uCE74\uCFE0\uB97C \uAF64 \uC758\uC9C0\uD588\uB2E4. \uADF8\uB97C \uACC4\uC18D \uC606\uC5D0 \uB454\uAC83\uB3C4 \uADF8 \uAE4C\uB2ED\uC774\uC5C8\uB2E4. \uB611\uAC19\uC774 \uC54C\uC9C0 \uBABB\uD558\uB294 \uC774\uC57C\uAE30\uB97C \uB4E4\uC5B4\uB3C4 \uC11C\uB958 \uB530\uC704 \uBCF4\uB2E4 \uCE74\uCFE0\uC758 \uC774\uC57C\uAE30\uB97C \uB4E3\uB294\uAC83\uC774 \uBA87\uBC30\uB294 \uC990\uAC70\uC6E0\uB2E4. \uB2E4\uB9CC \uCE74\uCFE0\uB294 \uC7A5\uAD00\uC774 \uC790\uAE38 \uC758\uC9C0\uD558\uACE0 \uC788\uB2E4\uACE4 \uC0C1\uC0C1\uB3C4 \uBABB\uD588\uB2E4.",
