  "text" : "\uC5EC\uAE30\uC11C \uC791\uC804 \uC2DC\uC791\uC740 \uB0B4\uC77C\uC774\uB2E4, \uB77C\uACE0 \uD588\uC9C0\uB9CC \uBA87\uC2DC\uC5D0 \uC2DC\uC791\uC778\uC9C0\uB294 \uB9D0\uD558\uC9C0 \uC54A\uC558\uACE0, \uAD50\uB300\uAC00  \uC790\uC815\uC5D0 \uC774\uB8E8\uC5B4\uC9C0\uB2E4\uBA74 \uBE14\uB8E8\uB178\uAC00 \uB9D0\uD55C \uB0B4\uC77C\uC740 \uAD50\uB300 \uC774\uD2C0\uC9F8\uC778\uAC00? \uC989 \uBE14\uB8E8\uB178\uAC00 \uCCAB\uB0A0\uC5D0 \uBB34\uC5C7\uC744 \uD588\uB294\uC9C0\uB294 \uBD88\uBA85, \uC7A5\uAD00\uB2D8\uC744 \uBE7C\uB3CC\uB9B0 \uC2DC\uC810\uC774 \uCE74\uCFE0\uC640 \uC57D\uC18D\uD55C \uC2DC\uC810\uC778\uC9C0\uB3C4 \uBD88\uBA85.",
