  "text" : "\uADF8 \uACFC\uC815\uC5D0\uC11C \uC7A5\uAD00\uC774 \uBC1B\uB294 \uC2A4\uD2B8\uB808\uC2A4\uB294 \uC0C1\uB2F9\uD588\uB2E4. \uC2EC\uC9C0\uC5B4 \uAE00\uC790\uB3C4 \uC548\uC77D\uD614\uB2E4. \uB098\uB294 \uC124\uB9C8 \uAE00\uC744 \uBABB\uC77D\uC5C8\uB098? \uC544\uB2C8, \uC124\uB9C8. \uC7A5\uAD00\uC778\uB370. \uADF8 \uC0C1\uD669\uC5D0\uC11C \uC7A5\uAD00\uC774 \uC758\uC9C0\uAC00 \uAC00\uB294 \uC0AC\uB78C\uC740 \uCE74\uCFE0\uC600\uB2E4. \uADF8\uB7F4 \uC218 \uBC16\uC5D0 \uC5C6\uC5C8\uB2E4. \uACF5\uC801\uC774 \uAD00\uACC4 \uC18D\uC5D0 \uADF8\uB9CC\uC774 \uC0AC\uC801\uC778 \uC790\uAE30 \uC0AC\uB78C\uC774\uC5C8\uC73C\uB2C8\uAE4C.",
