  "text" : "\uC2A4\uD32C\uB2E4\uC778\uC774 \uB8E8\uCE58\uAE4C\uC9C0 \uD3EC\uC12D\uD558\uC9C0 \uC54A\uC740 \uC774\uC720\uB294 \uBB58\uAE4C \uC2F6\uAE30\uB3C4 \uD55C\uB370 \uC560\uCD08\uC5D0 \uC9C0\uD5A5\uC810\uC774 \uB2E4\uB97C \uAC83\uC744 \uBBF8\uB9AC \uC54C\uC544\uCC58\uB358\uAC74\uAC00 \uC2F6\uB2E4. \uB8E8\uCE58\uC758 \uB9D0\uB300\uB85C \uBE44\uBC00\uD589\uB3D9\uC758 \uAE30\uBCF8\uC740 \uCD5C\uC18C\uC778\uC6D0. \uAD73\uC774 \uC704\uD5D8\uC694\uC18C\uB97C \uB298\uB9B4 \uD544\uC694\uB294 \uC5C6\uC5C8\uACA0\uC9C0. \uB3D9\uC2DC\uC5D0 \uB8E8\uCE58\uCE21\uC774 \uD589\uB3D9\uD560\uAC70\uB77C\uB294 \uC0AC\uC2E4\uC744 \uCE74\uCFE0\uC5D0\uAC8C \uC804\uB2EC\uD568\uC73C\uB85C\uC368",
