  "text" : "\uC744 \uC815\uB3C4\uB85C \uBE14\uB8E8\uB178\uB97C \uD5A5\uD55C \uC2E0\uB8B0\uB3C4\uB3C4 \uB192\uC558\uC73C\uB2C8... \uADF8\uB9AC\uACE0 \uBE14\uB8E8\uB178\uB9CC\uD07C \uB2E4\uB978 \uC774\uB4E4\uC5D0\uAC8C \uC2E0\uB8B0\uBC1B\uB294 \uC0AC\uB78C\uB3C4 \uC5C6\uC5C8\uC744\uAC70\uB2E4. \n\uACB0\uB860\uC744 \uB9D0\uD558\uC790\uBA74\n\uBE14\uB8E8\uB178\uB294 \uC2A4\uD32C\uB2E4\uC778\uC758 \uD3B8\uC774\uBA70 \uCE74\uCFE0\uC758 \uC81C\uC548\uC5D0 \uD611\uB825\uD558\uB294 \uCC99 \uC7A5\uAD00\uB2D8\uC744 \uBE7C\uB3CC\uB9B4 \uACC4\uD68D\uC774\uB2E4. \uB8E8\uCE58\uCE21\uACFC \uCE74\uCFE0\uCE21\uC774 \uC2F8\uC6B0\uB294 \uC0AC\uC774 \uC5B4\uBD80\uC9C0\uB9AC\uB85C.",
