  "text" : "\uCE74\uCFE0\uAC00 \uBE14\uB8E8\uB178\uC5D0\uAC8C \uD611\uB825\uC744 \uC81C\uC548\uD558\uAE30 \uC804\uC5D0 \uC774\uBBF8 \uC2A4\uD32C\uB2E4\uC778\uC5D0\uAC8C \uD611\uB825\uC911\uC774\uC5C8\uC744 \uAC00\uB2A5\uC131\uC774 \uD06C\uB2E4. \uC544\uB9C8 \uC2A4\uD32C\uB2E4\uC778\uC740 \uC544\uCE74\uC774\uB204\uAC00 \uBB34\uC2A8 \uC77C\uC744 \uBC8C\uC77C \uC0DD\uAC01\uC774\uB77C\uBA74 \uB3C4\uC8FC\uC5D0 \uD2B9\uD654\uB41C \uB2A5\uB825\uC744 \uAC00\uC9C4 \uBE14\uB8E8\uB178\uB97C \uD3EC\uC12D\uD560\uAC70\uB77C\uACE0 \uC608\uC0C1\uD588\uC744\uC9C0\uB3C4. \uCD08\uAE30\uC5D0 \uC7A5\uAD00\uB2D8\uC758 \uD638\uC704\uB85C \uB8E8\uCE58 \uB2E4\uC74C \uC21C\uC11C\uB85C \uC784\uBA85\uD588",
