  "text" : "\uAC00\uC2B4\uAED8\uAC00 \uC800\uB9BF\uD588\uB2E4. \uC804\uC5D0\uB3C4 \uC774\uB807\uAC8C \uB300\uD654\uD588\uB2E4\uBA74 \uC88B\uC558\uC744\uD150\uB370. \uC7A5\uAD00\uC740 \uD604\uC7AC \uBFD0\uB9CC \uC544\uB2C8\uB77C \uACFC\uAC70\uC640 \uBBF8\uB798\uB3C4 \uAD81\uAE08\uD574\uD588\uB2E4. \uC5B4\uB9B4 \uB54C \uB10C \uC5B4\uB560\uC5B4? \uBB58 \uC88B\uC544\uD588\uC5B4? \uC9C0\uAE08\uC740 \uBB58 \uC88B\uC544\uD574? \uC88B\uC544\uD558\uB294 \uC74C\uC2DD\uC740? \uB0B4\uC77C\uB3C4 \uC274\uD150\uB370 \uBB50\uD560\uAC70\uC57C?",
