  "text" : "\uD2F0\uB098\uC9C0 \uC54A\uB294 \uC815\uB3C4\uB85C \uB458\uC740 \uC2DC\uAC04\uC744 \uAC19\uC774 \uBCF4\uB0C8\uB2E4. \uADF8 \uC804\uC5D0\uB3C4 \uCE74\uCFE0\uAC00 \uC9D1\uBB34\uC2E4\uC5D0 \uCC3E\uC544\uC624\uAE30\uB294 \uD588\uC5C8\uC73C\uB098 \uADF8 \uC804\uACFC\uB294 \uB2E4\uB978 \uC810\uC774 \uC788\uC5C8\uB2E4. \uCC28\uB97C \uB9C8\uC2E4 \uB54C \uC81C \uC55E\uC5D0 \uC549\uB294\uAC8C \uC544\uB2C8\uB77C \uC606\uC5D0 \uC549\uB294\uB2E4\uB358\uAC00, \uBA3C\uC800 \uB9D0\uC744 \uAC78\uACE0 \uC9C8\uBB38\uC744 \uD558\uACE0, \uCE74\uCFE0\uC5D0 \uB300\uD574 \uAD81\uAE08\uD574\uD55C\uB2E4\uB294 \uAC83\uC774\uC5C8\uB2E4.",
