  "text" : "\uAC70\uC9D3\uB9D0\uC774 \uB298\uBA74\uC11C \uCE74\uCFE0\uB294 \uC7A5\uAD00\uACFC \uD568\uAED8\uD558\uB294 \uC2DC\uAC04 \uB610\uD55C \uB298\uC5C8\uB2E4. \uC7A5\uAD00\uC774 \uC694\uAD6C\uD588\uAE30 \uB54C\uBB38\uC774\uC5C8\uB2E4. \uD558\uC9C0\uB9CC \uCE74\uCFE0\uB294 \uC81C \uAC70\uC9D3\uB9D0\uC774 \uB2E4\uB978 CP9\uB4E4\uC5D0\uAC8C \uBC1C\uAC01\uB418\uC5C8\uB2E4\uAC00\uB294 \uC548\uB41C\uB2E4\uACE0 \uC0DD\uAC01\uD588\uB2E4. \uADF8\uB798\uC11C \uBE44\uBC00\uC5F0\uC560\uB77C\uB294 \uAC70\uC9D3\uC744 \uB367\uBD99\uC600\uB2E4.",
