  "text" : "\uC7A5\uB09C\uC774\uC5C8\uB2E4\uACE0, \uC0AC\uB791\uC740 \uBB34\uC2A8 \uC7A5\uAD00\uC740 \uB098\uD55C\uD14C \uADF8\uB7F0 \uAC10\uC815 \uD488\uC740 \uC801 \uC5C6\uB2E4\uACE0 \uB2E4\uAE09\uD788 \uB9D0\uD558\uB824\uACE0 \uD588\uB294\uB370 \uB9C8\uC8FC\uD55C \uC7A5\uAD00\uC758 \uD45C\uC815\uC774 \uC804\uC5D0 \uBCF8 \uC801 \uC5C6\uB294 \uD45C\uC815\uC774\uB77C \uCE74\uCFE0\uC758 \uB9D0\uBB38\uC774 \uB9C9\uD614\uB2E4. \uC7A5\uAD00\uC740 \uCC2C\uCC2C\uD788 \uC0DD\uAC01\uD574\uBCF4\uACA0\uB2E4\uBA70 \uB108\uB3C4 \uB3C4\uC640\uB2EC\uB77C\uACE0 \uC598\uAE30\uD588\uB2E4. \uCE74\uCFE0\uB294 \uC9C4\uC9DC \uD070\uC77C\uB0AC\uB2E4\uACE0 \uC0DD\uAC01\uD588\uB2E4.",
