  "text" : "\uB9D0\uB3C4 \uC548\uB418\uB294 \uC18C\uB9AC \uB9D0\uB77C\uACE0 \uD654\uAC19\uC9C0\uB3C4 \uC54A\uC740 \uD654\uB97C \uB0BC \uC904 \uC54C\uC558\uB294\uB370. \uC7A5\uAD00\uC740 \uC7A0\uC2DC \uD6C4 \uACE0\uAC1C\uB97C \uB4E4\uC5C8\uB2E4. \uD45C\uC815\uC774 \uC0AC\uBB47 \uC9C4\uC9C0\uD588\uB2E4. \uC7A5\uAD00\uC774 \uAE30\uC5B5\uC744 \uB5A0\uC62C\uB824 \uBCF4\uB824\uACE0 \uD588\uC73C\uB098 \uAE30\uC5B5\uC774 \uC548\uB09C\uB2E4\uACE0, \uBBF8\uC548\uD558\uB2E4\uACE0 \uB9D0\uD588\uB2E4. \uAE30\uC5B5\uD574\uB0B4\uB824\uACE0 \uB178\uB825\uD558\uACA0\uB2E4\uACE0 \uD588\uB2E4. \uCE74\uCFE0\uB294 \uB9DD\uD588\uB2E4\uACE0 \uC0DD\uAC01\uD588\uB2E4.",
