  "text" : "\uC7A5\uAD00\uC758 \uD45C\uC815\uC740 \uBB34\uC5B4\uB77C \uC124\uBA85\uD558\uAE30 \uD798\uB4E0 \uD45C\uC815\uC774\uC5C8\uB2E4. \uADF8\uB7EC\uB354\uB2C8 \uB2E4\uC2DC \uB418\uBB3C\uC5C8\uB2E4. \uB108\uB791, \uB098\uB791? \uCE74\uCFE0\uB294 \uBED4\uBED4\uD558\uAC8C \uADF8\uB807\uB2E4\uB124, \uD558\uACE0 \uB2F5\uD574 \uC8FC\uC5C8\uB2E4. \uC7A5\uAD00\uC740 \uD55C\uB3D9\uC548 \uB9D0 \uC5C6\uC774 \uACE0\uAC1C\uB9CC \uC219\uC774\uACE0 \uC788\uC5C8\uB2E4. \uCE74\uCFE0\uB294 \uC790\uAE30 \uC608\uC0C1\uACFC\uB294 \uB2E4\uB974\uAC8C \uD758\uB7EC\uAC00\uACE0 \uC788\uC74C\uC744 \uB290\uAF08\uB2E4.",
