  "text" : "\uADF8 \uD6C4\uC5D0\uB3C4 \uC7A5\uAD00\uC758 \uBC18\uC751\uC744 \uBCF4\uBA70 \uB180\uB824\uBA39\uC744 \uC218 \uC788\uC744 \uAC83 \uAC19\uC558\uB2E4. \uADF8\uB798\uC11C \uCE74\uCFE0\uB294 \uC7A5\uAD00\uC758 \uBB3C\uC74C\uC5D0 \uB2F5\uD588\uB2E4.\n\n\uC7A5\uAD00\uACFC \uB098\uB294 \uC0AC\uB791\uC744 \uD588\uC5C8\uB124. \n\n\uCE74\uCFE0\uB294 \uC774 \uB9D0\uC744 \uD574\uC11C\uB294 \uC548\uB410\uC5C8\uB2E4. \uD558\uC9C0\uB9CC \uD558\uACE0\uB9D0\uC558\uB2E4. \uB3CC\uC774\uD0AC \uC218\uB294 \uC5C6\uC5C8\uB2E4. \uB2F9\uC2DC \uCE74\uCFE0\uB294 \uC7AC\uBBF8\uC788\uACA0\uB2E4\uB294 \uC0DD\uAC01 \uBFD0\uC774\uC5C8\uB2E4.",
