  "text" : "\uCE74\uCFE0\uB294 \uC5EC\uAE30\uAE4C\uC9C0 \uB9D0\uD558\uBA74\uC11C\uB294 \uBCC4\uB2E4\uB978 \uC0DD\uAC01\uC774 \uB4E4\uC9C0 \uC54A\uC558\uB2E4. \uBE68\uB9AC \uAE30\uC5B5\uC774 \uB3CC\uC544\uC640\uC57C\uD560\uD150\uB370. \uD558\uB294 \uC815\uB3C4\uC600\uB2E4. \uADF8\uB7F0\uB370 \uC7A5\uAD00\uC740 \uCE74\uCFE0\uC5D0\uAC8C \uBB3C\uC5C8\uB2E4. \uADF8\uB7FC \uB108\uB791 \uB098\uB294 \uCE5C\uD588\uC5B4? \uCE74\uCFE0\uB294 \uC2DC\uB3D9\uC774 \uAC78\uB838\uB2E4. \uC7A0\uAE50 \uB3D9\uC548 \uC7AC\uBBF8\uC788\uAC8C \uB180\uB9B4 \uC218 \uC788\uACA0\uB2E4\uACE0 \uC0DD\uAC01\uD588\uB2E4.",
