  "text" : "\uC7A5\uAD00\uB2D8\uC774 \uC5B4\uB290 \uB0A0 \uC5B4\uC774\uC5C6\uAC8C\uB3C4 \uC790\uAE30 \uBC1C\uC5D0 \uAC78\uB824 \uB118\uC5B4\uC84C\uB2E4\uAC00 \uAE30\uC5B5\uC0C1\uC2E4\uC99D\uC5D0 \uAC78\uB824\uC11C \uC544\uBB34\uAC83\uB3C4 \uBAA8\uB974\uB294 \uBC31\uC9C0 \uC0C1\uD0DC\uAC00 \uB418\uC5C8\uB2E4. \uC758\uC0AC\uB294 \uC77C\uC2DC\uC801\uC778 \uAC83\uC774\uB77C\uBA70 \uACE7 \uB3CC\uC544\uC62C\uAC70\uB77C\uACE0 \uC774\uC57C\uAE30\uD588\uB2E4. \uADF8 \uB54C \uC5D0\uB2C8\uC5D0\uC2A4 \uB85C\uBE44\uC5D0 \uB0A8\uC544\uC788\uB358 \uCE74\uCFE0\uB294 \uB300\uBC94\uD558\uAC8C \uC7A5\uB09C\uC744 \uCCD0\uBCF4\uAE30\uB85C \uD558\uB294\uB370...",
