  "text" : "\uADFC\uB370 \uC0AC\uAD50\uB304\uC2A4 \uC0DD\uAC01\uD558\uC790\uB9C8\uC790 \uD55C\uCC38 \uACE0\uBBFC\uD55C \uAC8C \uADF8... \uACE0\uB4F1\uD559\uAD50 \uB54C \uC0AC\uAD50\uB304\uC2A4... \uBC30\uC6B0\uC9C0 \uC54A\uB098...? \uBB34\uC6A9 \uC218\uC5C5 \uCEE4\uB9AC\uD058\uB7FC\uC5D0 \uAF2D \uC788\uC5C8\uB358 \uAE30\uC5B5\uC774... \uC74C \uBC30\uC6E0\uC5B4\uB3C4 \uACE03\uB550 \uC548\uD588\uC73C\uB2C8 \uC78A\uC5C8\uB2E4\uACE0 \uCE69\uC2DC\uB2E4. \uC544\uB2C8\uBA74 \uC5EC\uC790 \uCE21\uC740 \uCC98\uC74C\uC774\uB2C8\uAE4C... \uAC19\uC740 \uC774\uC720\uB85C...",
