  "text" : "\uB0A8\uC131\uC740 \uC190\uC744 \uACE7\uAC8C \uD3B4 \uC5EC\uC131\uC758 \uACAC\uAC11\uACE8\uC744 \uC9DA\uB294 \uC815\uB3C4\uB85C\uB9CC \uC548\uACE0, \uC5EC\uC131\uC740 \uC5C4\uC9C0\uB9CC \uD3BC\uCCD0 \uB0A8\uC131\uC758 \uD314\uB69D \uC911\uAC04\uC5D0 \uAC78\uCE58\uAC8C \uB418\uC9C0\uC694. \uC774 \uB54C \uD314\uC740 \uBD99\uC9C0 \uC54A\uB3C4\uB85D. \uB9CC\uC57D \uC774 \uC774\uC0C1\uC758 \uBD88\uD544\uC694\uD55C \uC811\uCD09\uC774 \uC0DD\uAE34\uB2E4\uBA74- \uC751 \uADF8\uB798, \uAC70\uC808\uD558\uB77C\uACE0. ...\uADF8\uB0E5 \uB108\uB791\uB9CC \uCD94\uBA74 \uC548\uB3FC?",
