  "text" : "\"\uB124\uAC00 \uB9AC\uB4DC\uC796\uC544. \uD558\uB294 \uB300\uB85C \uB530\uB77C\uAC00\uBA74 \uC548 \uB3FC?\"\n\"\uC7A5\uAD00\uB2D8. \uCDA4\uC744 \uB9AC\uB4DC\uD55C\uB2E4\uB294 \uAC74 \uBA3C\uC800 \uC6C0\uC9C1\uC778\uB2E4\uB294 \uB73B\uC774\uC9C0 \uC0C1\uB300\uB97C \uB04C\uACE0\uB2E4\uB2CC\uB2E4\uB294 \uB73B\uC774 \uC544\uB2D9\uB2C8\uB2E4. \uB9AC\uB4DC\uB97C \uB530\uB974\uC154\uB3C4, \uB04C\uB824\uB2E4\uB2C8\uC9C0 \uC54A\uC73C\uC154\uC57C\uD558\uC8E0. \uB9CC\uC57D \uC0C1\uB300\uAC00 \uBC30\uB824\uC5C6\uC774 \uBC00\uACE0\uB2F9\uAE34\uB2E4\uBA74 \uADF8 \uBB34\uB840\uB97C \uC774\uC720\uB85C \uAC70\uC808\uD558\uC154\uB3C4 \uB429\uB2C8\uB2E4\"",
