  "text" : "\uB192\uC73C\uC2E0 \uB204\uAD70\uAC00\uAC00 \uAD50\uB958\uB97C \uC704\uD574 \uC5B4\uCA4C\uACE0\uD558\uBA70 \uB9CC\uB4E0 \uC0AC\uAD50\uD68C\uC5D0 \uCC38\uC11D\uD558\uB77C\uB294 \uCD08\uB300\uC7A5\uC744 \uBCF4\uB0C8\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uBB3C\uB860 \uC624\uC7A5\uB2D8 \uB4DC\uB808\uC2A4 \uCC28\uB9BC+\uCDA4 \uC2E0\uCCAD\uC744 \uC704\uD55C \uC218\uC791. \uC6D0\uC791\uC5D0\uC11C\uB3C4 \uC774\uB534 \uC774\uBCA4\uD2B8\uAC00 \uC788\uC5C8\uB098? \uC73C \uC18C\uB984. \uD558\uBA70 \uC544\uCE74\uC774\uB204\uC640 \uC544\uC624\uD0A4\uC9C0\uAC00 \uD0F1\uACE0\uB97C \uCD94\uB294 \uAC83\uAE4C\uC9C0 \uC0C1\uC0C1\uD558\uACE4 \uB1CC\uB97C \uAED0\uB2E4.",
