  "text" : "\"\uC7A5\uAD00\uB2D8. \uC190\uC744 \uC7A1\uC744 \uB54C \uC190\uBAA9\uC740 \uAEBD\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\"\n\uC190\uC744 \uC7A1\uAE30\uAC00 \uBB34\uC12D\uAC8C \uD478\uB529\uC774 \uC190\uBAA9\uC744 \uC9C0\uAE0B\uC774 \uB20C\uB7EC \uBC14\uB974\uAC8C \uD3B4\uC9C0\uB3C4\uB85D \uAD50\uC815\uD558\uBA70 \uC9C0\uC801\uD588\uB2E4. \uC2DC\uC791\uBD80\uD130 \uB9C9\uD788\uB294\uB370. \uC874\uB098 \uB9C9\uB9C9\uD558\uB124. \uB0B4\uAC00 \uC774\uAC78 \uC65C \uD574\uC57C\uD558\uC9C0... \uC2DC\uBC1C \uC0AC\uAD50\uD68C.",
