  "text" : "\uC644\uBCBD\uD55C \uBCF4\uC88C\uAD00\uC774 \uB418\uAE30 \uC704\uD574 \uC694\uB9AC\uC218\uB828\uC5D0 \uB3CC\uC785\uD55C \uD130\uD3EC\uD0A4!\n\uC2DC\uC2DD\uC744 \uC704\uD574 cp0\uC744 \uC601\uC785\uD588\uB2E4:\n\n\uC7AC: \uCE6D\uCC2C\uD558\uB824 \uD558\uC9C0\uB9CC \uD798\uB4E0 \uD45C\uC815\uC774\uB2E4\n\uCE7C: \uBA39\uAE30\uB97C \uAC70\uBD80\uD55C\uB2E4\n\uBE14: \uC694\uB9AC\uB97C \uAE08\uC9C0\uD55C\uB2E4\n\uCE74: \uBE44\uC6C3\uC73C\uBA70 \uC694\uB9AC\uB97C \uB358\uC838\uBC84\uB9B0\uB2E4\n\uB8E8: \uC7A5\uAD00\uC744 \uB3C5\uC0B4\uD558\uB824\uB294 \uAC74\uAC00. \uC9C0\uAC74\uC744 \uB0A0\uB9B0\uB2E4",
