  "text" : "\uADF8 \uB0A0 CP0\uC740 \uC7A5\uAD00\uC744 \uCC3E\uC544\uC654\uB358 \uB0A0\uB4E4 \uC911 \uAC00\uC7A5 \uB9CC\uC871\uC2A4\uB7FD\uAC8C \uC5D0\uB2C8\uC5D0\uC2A4 \uB85C\uBE44\uB97C \uB5A0\uB0AC\uB2E4. \uADF8\uB9AC\uACE0 \uD6C4\uC5D0 \uC544\uAE30\uCE58\uD0C0\uAC00 \uB098\uB77C \uC783\uC740 \uD45C\uC815\uC73C\uB85C \uC7A5\uAD00\uC758 \uBC29 \uC55E\uC5D0\uC11C \uC560\uC639\uAC70\uB9AC\uACE0 \uC6B8\uC5B4\uB304 \uAC83\uC740 \uC5D0\uB2C8\uC5D0\uC2A4 \uB85C\uBE44\uC758 \uBAA8\uB450\uAC00 \uC544\uB294 \uC774\uC57C\uAE30\uC600\uB2E4.",
