  "text" : "\uADF8\uB7EC\uB354\uB2C8 \uB2E4\uB4E4 \uB8E8\uCE58\uAC00 \uD588\uB358\uAC83 \uCC98\uB7FC \uC5EC\uD0DC\uAECF \uD574\uC628 \uC784\uBB34\uB4E4\uC744 \uB098\uC5F4\uD558\uB824\uD588\uB2E4. \uC7A5\uAD00\uC740 \uBCC4\uB85C \uB4E3\uACE0 \uC2F6\uC740 \uB0B4\uC6A9\uC774 \uC544\uB2C8\uC5C8\uB2E4. \uC804\uBD80 \uC0B4\uC778\uC774 \uB4E4\uC5B4\uAC04 \uB0B4\uC6A9\uC774\uC5C8\uAE30 \uB54C\uBB38\uC774\uB2E4. \uC7A5\uAD00\uC740 \uADF8\uB0E5 \uBAA8\uB450\uC758 \uBA38\uB9AC\uB97C \uD55C \uBC88\uC529 \uC4F0\uB2E4\uB4EC\uC5B4 \uC8FC\uC5C8\uB2E4.",
