  "text" : "\uB8E8\uCE58\uB294 CP0 \uB418\uACE0\uC11C \uC9C0\uAE08\uAE4C\uC9C0 \uC218\uD589\uD55C \uC784\uBB34\uB4E4\uC744 \uC904\uC904 \uC74A\uC5C8\uB2E4. ?? \uB098\uBA38\uC9C0 CP0\uB4E4\uACFC \uC7A5\uAD00\uC740 \uBB3C\uC74C\uD45C\uB97C \uB744\uC5C8\uB2E4. \uB8E8\uCE58\uAC00 \uAC00\uC7A5 \uCD5C\uADFC\uC5D0 \uB9E1\uC558\uB358 \uC784\uBB34\uB97C \uC774\uC57C\uAE30\uD558\uACE4 \uACE0\uAC1C\uB97C \uC219\uC600\uB2E4. \uC7A5\uAD00\uC740 \uB8E8\uCE58\uAC00 \uC6D0\uD558\uB294 \uBC14\uB97C \uBC14\uB85C \uC9C1\uAC10\uD588\uB2E4. \uADF8\uB9AC\uACE0 \uC598 \uBBF8\uCCE4\uB098\uBCF4\uB2E4\uACE0 \uC0DD\uAC01\uD588\uB2E4.",
