  "text" : "\uC7A5\uAD00\uC744 \uAFF0\uB6AB\uC5B4 \uBCF8 \uADF8\uB4E4\uC740 \uD558\uB098\uD558\uB098 \uC9DA\uC5B4\uC8FC\uC5C8\uB2E4. \uC774\uAC74 \uC774\uB807\uACE0 \uC800\uAC74 \uC800\uB807\uACE0. \uC7A5\uAD00\uC740 \uB0B4\uAC00 \uADF8\uB7AC\uB358\uAC00 \uC2F6\uC5C8\uB2E4. \uADF8\uB798\uC11C \uBB50\uC9C0? \uC790\uAE30\uB4E4\uD55C\uD14C \uD558\uB358\uB300\uB85C \uD558\uB77C\uB294\uAC74\uAC00? \uADF8\uB7F0\uB370 \uC5EC\uD0DC\uAECF \uAC00\uB9CC\uD788 \uC788\uB358 \uB8E8\uCE58\uAC00 \uC785\uC744 \uC5F4\uC5C8\uB2E4.",
