  "text" : "\uB354 \uAE34 \uCE68\uBB35\uC774 \uC774\uC5B4\uC84C\uB2E4. \uC7A5\uAD00\uC740 \uC2DC\uBB34\uB8E9\uD574\uC838\uC120 \uC790\uC2E0\uACFC \uC2DC\uC120\uC744 \uB9C8\uC8FC\uD558\uC9C0 \uC54A\uB294 CP0\uC744 \uBCF4\uBA70 \uBB34\uC5B8\uAC00 \uAD34\uB9AC\uAC10\uC744 \uB290\uAF08\uB2E4. \uC9C0\uAE08 \uC598\uB124\uAC00 \uB0B4\uAC00 \uCC28\uBCC4\uC744 \uD558\uACE0 \uC788\uB2E4\uACE0 \uB9D0\uD558\uB294\uAC74\uAC00? \uC7A5\uAD00\uC740 \uCE68\uBB35 \uC18D\uC5D0\uC11C \uC9C0\uB09C \uB0A0\uC744 \uB418\uC9DA\uC5B4 \uBCF4\uC558\uC73C\uB098 \uB531\uD788 \uBCC4\uB2E4\uB978\uAC78 \uB290\uB07C\uC9C4 \uBABB\uD588\uB2E4.",
