  "text" : "\uC7A5\uAD00\uC740 \uC774\uD574\uAC00 \uC548\uAC04\uB2E4\uB294 \uD45C\uC815\uC774\uC5C8\uB2E4. \uC544\uC9C1 \uC560\uC796\uC544? \uADF8\uB9AC\uACE0 \uB9C8\uB0E5 \uC624\uB0D0\uC624\uB0D0 \uD558\uACE0 \uC788\uC9C4 \uC54A\uB2E4\uACE0, \uADF8 \uC560\uB294 \uC784\uBB34\uB3C4 \uC81C\uB300\uB85C \uC218\uD589\uD558\uACE0 \uC218\uB828\uB3C4 \uAFB8\uC900\uD788, \uADF8\uB9AC\uACE0 \uC5F4\uC2EC\uD788 \uD558\uACE0 \uC788\uB2E4\uACE0 \uB9D0\uD588\uB2E4. \uC7A0\uC2DC \uCE68\uBB35\uC774 \uAC10\uB3CC\uACE0, \uADF8\uB4E4\uC740 \uB05D\uB0B4 \uB9D0\uD588\uB2E4. \uC6B0\uB9AC\uD55C\uD14C\uB294 \uADF8\uB7EC\uC9C0 \uC54A\uC9C0 \uC54A\uC558\uB0D0\uACE0.",
