  "text" : "\uADF8 \uC560 \uC790\uCCB4\uAC00 \uB9C8\uC74C\uC5D0 \uC548\uB4DC\uB294\uAC8C \uC544\uB2C8\uB77C \uC7A5\uAD00\uC774 \uADF8 \uC560\uB97C \uB300\uD558\uB294 \uD0DC\uB3C4\uAC00 \uB9C8\uC74C\uC5D0 \uC548\uB4E0\uB2E4, \uACE0 \uADF8\uB294 \uB2F5\uD588\uB2E4. \uC7A5\uAD00\uC774 \uBB34\uC2A8 \uC18C\uB9AC\uC778\uC9C0 \uBAA8\uB974\uACA0\uB2E4\uB294 \uD45C\uC815\uC744 \uC9D3\uC790 \uADF8\uB4E4\uC740 \uB2F5\uB2F5\uD558\uB2E4\uB294 \uB4EF \uB9D0\uD588\uB2E4. \uB108\uBB34 \uC5B4\uB9AC\uAD11\uC744 \uBC1B\uC544\uC8FC\uB294 \uAC83\uC774 \uC544\uB2C8\uB0D0. \uC624\uB0D0\uC624\uB0D0 \uD558\uB294\uAC8C \uC544\uB2C8\uB0D0. \uD558\uACE0.",
