  "text" : "\uCE58\uD0C0\uB294 \uD5E4\uC2E4 \uC6C3\uC5C8\uB2E4. \uC7A5\uAD00\uC740 \uBC29\uC5D0 \uB3CC\uC544\uAC00 \uC26C\uB77C \uB9D0\uD588\uB2E4. \uCE58\uD0C0\uB294 \uAC00\uAE30 \uC2EB\uC740 \uB208\uCE58\uB85C \uC6B0\uBB3C\uCB48\uBB3C \uAC70\uB9AC\uACE0 \uC788\uC73C\uB2C8 CP0 \uC911 \uD558\uB098\uAC00 \uB208\uCE58\uB97C \uC8FC\uC5C8\uB2E4. \uC560\uB3C4 \uC544\uB2C8\uACE0, \uD558\uBA74\uC11C. \uC7A5\uAD00\uC740 \uB2F9\uD669\uC2A4\uB7FD\uB2E4\uB294 \uD45C\uC815\uC744 \uC9C0\uC5C8\uB2E4. \uC7A5\uAD00\uC740 \uB098\uC911\uC5D0 \uC624\uB77C\uBA70 \uCE58\uD0C0\uB97C \uBC29\uC73C\uB85C \uB3CC\uB824\uBCF4\uB0C8\uB2E4.",
