  "text" : "CP0\uC73C\uB85C \uD568\uAED8\uD558\uC790\uB294 \uAD8C\uC720\uB97C \uAC70\uC808\uD55C\uAC83\uC740 \uC7A5\uAD00\uC774\uC5C8\uB2E4. \uADF8\uB294 \uC228\uAE40 \uC5C6\uC774 \uAC10\uC815\uC744 \uB4DC\uB7EC\uB0B4\uBA70 \uC9C8\uC0C9\uD588\uB2E4. \uBA85\uBC31\uD55C \uAC70\uC808\uC5D0 \uADF8\uB4E4\uC740 \uBB3C\uB7EC\uC124 \uC218 \uBC16\uC5D0 \uC5C6\uC5C8\uB2E4. \uC544\uC9C1\uAE4C\uC9C0\uB3C4 \uADF8\uB4E4\uC740 \uC7A5\uAD00\uC758 \uAC70\uC808\uC5D0 \uC544\uC26C\uC6CC\uD588\uB2E4. \uB354 \uC774\uC0C1 \uAD8C\uD558\uC9C0 \uC54A\uC740 \uAC83\uC740 \uC7A5\uAD00\uC774 \uB354 \uBA40\uC5B4\uC9C8\uAE4C\uBD10\uC11C \uC600\uB2E4.",
