  "text" : "\uC7A5\uAD00\uC740 \uADF8\uB807\uAC8C \uB9D0\uD588\uB2E4. \uC815\uB9D0 \uADF8\uB7AC\uAE30 \uB54C\uBB38\uC774\uB2E4. \uC774\uB978 \uC138\uB300 \uAD50\uCCB4\uB85C \uD604 CP9\uC758 \uC5F0\uB839\uB300\uB294 \uB0AE\uC558\uB2E4. \uB2E4\uB978 CP\uB4E4\uACFC \uBE44\uAD50\uD558\uBA74 \uAC15\uD588\uC9C0\uB9CC \uC11C\uB458\uB7EC CP9\uC5D0 \uB123\uC740 \uD0D3\uC5D0 \uC218\uB828\uACFC \uC784\uBB34\uB97C \uD568\uAED8 \uD558\uB294 \uC77C\uB3C4 \uC788\uC5C8\uB2E4. CP0\uC740 \uBFCC\uB4EF\uD558\uBA74\uC11C\uB3C4 \uC7A5\uAD00\uC744 \uAC71\uC815\uD588\uB2E4.",
