  "text" : "\uC2AC\uCA4D CP0\uC758 \uB208\uCE58\uB97C \uBCF8 \uC7A5\uAD00\uC740 \uCE58\uD0C0\uAC00 \uADF8\uB4E4\uC758 \uC2EC\uAE30\uB97C \uAC74\uB4DC\uB838\uB2E4\uB294\uAC78 \uC54C\uC544\uCC58\uB2E4. \uC7A5\uAD00\uC740 \uCE58\uD0C0\uC5D0\uAC8C \uBC29\uC5D0 \uB3CC\uC544\uAC00\uB77C\uACE0 \uB9D0\uD588\uB2E4. \uCE58\uD0C0\uB294 \uC785\uC744 \uC090\uC8FD \uB0B4\uBC00\uC5C8\uC9C0\uB9CC \uADF8\uB807\uB2E4\uACE0 \uB9D0\uC744 \uC548\uB4E3\uC9C4 \uC54A\uC558\uB2E4. \uCE58\uD0C0\uB294 \uB098\uAC00\uBA74\uC11C \uC7A5\uAD00\uACFC CP0\uC5D0\uAC8C \uC778\uC0AC\uD558\uB294 \uAC83\uB3C4 \uC78A\uC9C0 \uC54A\uC558\uB2E4.",
