  "text" : "\uC800\uAC70 \uBB50\uC57C? \uD558\uACE0 CP0 \uC911 \uB204\uAD70\uAC00 \uB9D0\uC744 \uB0B4\uBC49\uC5C8\uB2E4. \uC7A5\uAD00\uC740 \uD604 CP9\uB77C\uB2C8\uAE4C. \uD558\uACE0 \uB9D0\uD588\uB2E4. \uADF8\uAC8C \uC544\uB2C8\uB77C... \uD558\uACE0 \uB9D0\uC744 \uC774\uC73C\uB824\uB294\uB370 \uCE58\uD0C0\uAC00 \uC790\uAE30\uC18C\uAC1C\uB97C \uD588\uB2E4. \uD55C\uBC88\uCBE4 \uB9CC\uB098\uBCF4\uACE0\uC2F6\uC5C8\uB2E4\uB294 \uB9D0\uC744 \uB367\uBD99\uC774\uBA74\uC11C. \uC7A5\uAD00\uC5D0\uAC8C \uB2EC\uB77C\uBD99\uC740 \uCC44\uC600\uB2E4. CP0\uC758 \uC2EC\uAE30\uAC00 \uBD88\uD3B8\uD574\uC84C\uB2E4.",
