  "text" : "\uC2AC\uC2AC \uB3CC\uC544\uC624\uB77C\uB294 \uC7A5\uAD00\uC758 \uB9D0\uC5D0 \uCE58\uD0C0\uB294 \uC0AC\uB78C\uC73C\uB85C \uBCC0\uD574 \uAE30\uC9C0\uAC1C\uB97C \uD53C\uACE4 \uC7A5\uAD00\uC5D0\uAC8C \uB2EC\uB77C\uBD99\uC5C8\uB2E4. \uB098\uC774\uAC00 \uCE74\uCFE0\uAC00 \uCC98\uC74C \uC7A5\uAD00\uC744 \uB9CC\uB0AC\uB358 \uB54C\uC640 \uAC19\uAC70\uB098 \uD55C\uC0B4 \uC988\uC74C \uB9CE\uAC70\uB098 \uC801\uC5B4\uBCF4\uC600\uB2E4. \uC7A5\uAD00\uC740 \uB2EC\uB77C\uBD99\uB294 \uCE58\uD0C0\uB97C \uB5BC\uC5B4\uB0B4\uC9C0 \uC54A\uC558\uB2E4. \uB298 \uADF8\uB7AC\uAE30 \uB54C\uBB38\uC774\uB2E4. CP0\uC758 \uD45C\uC815\uC774 \uAD73\uC5C8\uB2E4.",
