  "text" : "\uC784\uBB34\uAC00 \uC5C6\uC744 \uB54C \uCE58\uD0C0 \uBAA8\uC2B5\uC73C\uB85C \uBB38\uC744 \uC5F4\uACE0 \uB4E4\uC5B4\uC640 \uC81C \uBC1C\uBC11\uC5D0 \uC790\uB9AC\uC7A1\uACE0 \uACE0\uB871\uB300\uBA70 \uC7A0\uB4DC\uB294\uAC8C \uC81C\uBC95 \uADC0\uC5EC\uC6E0\uB2E4. \uADF8\uB7EC\uB358 \uC5B4\uB290 \uB0A0 \uC804 CP9\uAC00 \uC7A5\uAD00\uC758 \uC548\uBD80\uB97C \uC0B4\uD53C\uB7EC \uCC3E\uC544\uC628\uB2E4. \uADF8\uB9AC\uACE0 \uADF8 \uBC1C\uBC11\uC758 \uCE58\uD0C0\uB97C \uBCF4\uACE0 \uB9CC\uB2E4. \uB2E4\uB4E4 \uC7A5\uAD00 \uBC1C\uBC11\uC758 \uCE58\uD0C0\uC640 \uB8E8\uCE58\uB97C \uBC88\uAC08\uC544 \uBCF4\uACE0..",
