  "text" : "\uC548\uB4E0 \uC5C5\uB4E0 \uB4E4\uCCD0\uB9E4\uACE0 \uBA40\uCA61\uD788 \uC784\uBB34 \uC218\uD589\uD558\uAC70\uB098 \uC774\uB3D9\uD558\uB294 cp0 \uBCF4\uACE0\uC2F6\uB2E4. \uC7A5\uAD00\uB2D8\uC740 \uB9CC\uB0A0 \uAC11\uC790\uAE30 \uC7A0\uB4DC\uB294 \uC790\uAE30\uAC00 \uC5B4\uC774\uC5C6\uACE0.. cp0 \uD558\uB77C \uBA85 \uBC1B\uC558\uC744 \uB54C \uC81C \uBAB8\uC0C1\uD0DC\uB294 \uC784\uBB34\uC5D0 \uC9C0\uC7A5\uC744 \uBBF8\uCE60\uAC81\uB2C8\uB2E4, \uD558\uACE0 \uBC18\uBC15\uD588\uB294\uB370 \uB8E8\uCE58\uAC00 \uCC3E\uC544\uC640\uC11C \uC7A5\uAD00\uB2D8\uC758 \uBAB8 \uC0C1\uD0DC \uC815\uB3C4\uC57C \uC784\uBB34\uC5D0",
