  "text" : "\uADF8\uB9AC\uACE0 \uC9C0\uB048\uAC70\uB9AC\uB294 \uB124\uC784\uC5D0 \uC800\uB3C4 \uBAA8\uB974\uAC8C \uAD50\uC815\uAE30 \uB2E4\uC2DC \uB9CC\uC9C0\uB294\uB370 \uB9CE\uC774 \uC544\uD504\uC2DC\uB0D0\uBA70 \uD478\uB529\uC774 \uADF8 \uC704\uC5D0 \uC190\uB300\uACE0, \uD478\uB529 \uC790\uC2E0\uC5D0\uAC8C \uD3EC\uB124\uADF8\uB9AC\uD504\uB85C \uC0C8\uACA8\uC9C4 \uB124\uC784\uC758 \uC8FC\uC778\uC774 \uC7A5\uAD00\uB2D8\uC774\uB77C\uB294\uAC70 \uC54C\uAC8C \uB418\uC5B4\uBC84\uB9AC\uACE0~~~ \uC65C \uD3EC\uB124\uADF8\uB9AC\uD3EC\uB85C \uC7A5\uAD00\uB2D8 \uC774\uB984\uC774? \uB77C\uB294\uAC83\uBCF4\uB2E4 \uC7A5\uAD00\uB2D8\uC774\uB791 \uB0B4\uAC00?",
