  "text" : "\uD654\uD3D0\uB2E8\uC704\uB294 \uC54C\uC9C0\uB9CC \uBB3C\uAC74\uAC00\uCE58\uB294 \uC798 \uBAB0\uB77C\uC11C \uC2DC\uC7A5\uBCF4\uB7EC \uAC14\uB2E4\uAC00 \uB364\uD130\uAE30\uB2F9\uD558\uBA74 \uADC0\uC5FD\uACA0\uB2E4. \uD604\uC0C1\uAE08 \uBA87\uB9CC\uBCA0\uB9AC \uADF8\uB7F0 \uAC83\uB9CC \uBCF4\uB2C8\uAE4C \uB2E8\uC704\uC5D0 \uB454\uAC10\uD574\uC838\uC11C \uBB3C\uBB3C\uC0AC\uD0D5 \uAC19\uC740 \uAC70 \uC0AC\uB294\uB370 \uC554 \uC0DD\uAC01\uC5C6\uC774 \uB9C9 7.0 \uC368\uC788\uC74C 700\uBCA0\uB9AC\uC778\uB370 70000\uBCA0\uB9AC \uB0B4\uBC84\uB9AC\uAD6C \uC624 \uC5BC\uB9C8 \uC548 \uD558\uB124 \uD574\uBC84\uB9AC\uAE30",
