  "text" : "\uBE44\uB300\uCE6D\uC801\uC778 \uAD00\uACC4\uC131\uC774 \uD478\uB529-\uC7A5\uAD00\uACFC \uBE44\uC2B7\uD55C \uAC83 \uAC19\uB2E4. \uD55C \uCABD\uC740 \uBBFF\uACE0, \uD55C \uCABD\uC740 \uC758\uC2EC\uD558\uACE0+\uC18D\uC774\uACE0.\n\n\uC790\uC138\uD788 \uC124\uBA85 \uC548 \uD558\uACE0 \uC7A5\uAD00\uB2D8\uC774 \uBBF8\uC548\uD574, \uC2E4\uC218\uC600\uC5B4~ \uB77C\uB358\uAC00 \uC5B4\uCA54 \uC218 \uC5C6\uC5C8\uC5B4~ \uC815\uB3C4\uB9CC \uB9D0\uD574\uB3C4 cp9 \uC598\uB4E4\uC740 \uC7A5\uAD00\uC744 \uB5A0\uB098\uC9C0 \uBABB\uD588\uC744 \uB4EF",
